INSERT INTO `text` VALUES (1,'\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]','utf-8'),(2,'Plugins for nagios\n============\n\n\n\n```bash\ngit clone https://bitbucket.org/shinespb/nagios_plugins.git\n```\n\n## What does it do?\n\ncheck_patterns_count counts files in directories with a structure like: \n/<base_path>/<year>/<month>/<day>/<hour>/<minute>\nand returns warning/critical/ok\n\n```\ncheck_patterns_count gets an arguments:\n	-t <minutes>  - Gets all directories for now to <minutes> ago. DEFAULT: 5 mins.\n	-c <int>	- File count for CRITICAL message. DEFAULT: 50\n	-w <int>	- File count for WARNING message DEFAULT: 100\n	-d <path>	- Base path where program will find structure like â€œ<year>/<month>/<day>/<hour>/<minute>â€. DEFAULT: /events_storage/phishing_detected/\n```','utf-8'),(3,'Plugins for nagios\n\n== Nagios plugins ==\n\n\n\n<code>\ngit clone https://bitbucket.org/shinespb/nagios_plugins.git\n</code>\n\n=== What does it do? ===\n\n\'\'\'check_patterns_count\'\'\' counts files in directories with a structure like: \n<code>\n/<base_path>/<year>/<month>/<day>/<hour>/<minute> and returns warning/critical/ok\n</code>\n\n<code>\n<pre>\ncheck_patterns_count gets an arguments:\n	-t <minutes>  - Gets all directories for now to <minutes> ago. DEFAULT: 5 mins.\n	-c <int>	- File count for CRITICAL message. DEFAULT: 50\n	-w <int>	- File count for WARNING message DEFAULT: 100\n	-d <path>	- Base path where program will find structure like â€œ<year>/<month>/<day>/<hour>/<minute>â€. DEFAULT: /events_storage/phishing_detected/\n</pre>\n</code>','utf-8'),(4,'\'\'\'Nagios description\'\'\'\n\n* [[Nagios_plugins]]\n\n== Installation of image ==\n\n=== Vagrant ===\n\n==== Prerequisites ====\n\n* vagrant (vagrantup.com), >= 1.5.3\n* virtualbox \n* ansible >= 1.9\n\nRunning [[Vagrant Image]] described by link.\n\n=== EC2 image installation ===\n\n==== Prerequisites ====\n\n* ansible >= 1.9\n* boto(package for python)   \'\'\'<code>pip install boto</code>\'\'\'','utf-8'),(5,'== Modules for nagios ==\n\n* [[Nagios_plugins]]\n\n== Installation of image ==\n\n=== Vagrant ===\n\n==== Prerequisites ====\n\n* vagrant (vagrantup.com), >= 1.5.3\n* virtualbox \n* ansible >= 1.9\n\nRunning [[Vagrant Image]] described by link.\n\n=== EC2 image installation ===\n\n==== Prerequisites ====\n\n* ansible >= 1.9\n* boto(package for python)   \'\'\'<code>pip install boto</code>\'\'\'\nRunning [[EC2 Image]] described by link.','utf-8'),(6,'== Prerequisites ==\n\n* Vagrant >= 1.5.3\n* Ansible >= 1.9\n* VirtualBox\n* git\n* python >= 2.7\n\n== Running Image ==\n\n* Install Vagrant from [http://www.vagrantup.com www.vagrantup.com]. Version must be \'\'\'>= 1.5.3\'\'\'\n* Install VirtualBox from [https://www.virtualbox.org/ www.virtualbox.org]\n* Install Ansible from [http://www.ansible.com/ www.ansible.com]. Required version \'\'\'>= 1.9\'\'\'\n\nClone code from repository\n<pre>git clone https://bitbucket.org/shinespb/ansible_task.git</pre>\n\nThen go to directory ansible task and run:\n<pre>\nvagrant up\n</pre>\n\nVagrant creates Virtual Machine, installs ubuntu 14.04 LTS and runs ansible.\nAnsible installs and setups all other software for this task like:\n* Nagios and additional plugins\n* Apache2\n* MySQL\n* MediaWiki\n\n== Settings for edit ==\n\n=== VM Settings ===\n\nVM settings can be set in file <ansible_variables.yml>\n<pre>\nmemory: 512\nvagrant_box: \"ubuntu/trusty64\"\nvms: 1\n</pre>\n\'\'\'Memory\'\'\' - means that vagrant will create Virtual Machines with this amount of RAM<br>\n\'\'\'vagrant_box\'\'\' - image to use. By default \"ubuntu/trusty64\". Ubuntu 14.04 LTS, x86_64<br>\n\'\'\'vms\'\'\' - Count of virtual machines that will be created<br>\n\n=== Software settings ===\nThere is a directory \"group_vars\" with file \"all\"\nIn this file you could change any parameters for this task','utf-8'),(7,'== Modules for nagios ==\n\n* [[Nagios_plugins]]\n\n== Installation of image ==\n\n=== Vagrant ===\n\n==== Prerequisites ====\n\n* vagrant (vagrantup.com), >= 1.5.3\n* virtualbox \n* ansible >= 1.9\n\n==== Image run ====\nRunning [[Vagrant Image]] described by link.\n\n=== EC2 image installation ===\n\n==== Prerequisites ====\n\n* ansible >= 1.9\n* boto(package for python)   \'\'\'<code>pip install boto</code>\'\'\'\n\n==== Image run ====\nRunning [[EC2 Image]] described by link.','utf-8'),(8,'=== EC2 image run ===\n\n\nthere is a text about running ec2 image','utf-8'),(9,'== Modules for nagios ==\n\n* [[Nagios_plugins]]\n\n== Installation of image ==\n\n=== Vagrant ===\n\n==== Prerequisites ====\n\n* vagrant (vagrantup.com), >= 1.5.3\n* virtualbox \n* ansible >= 1.9\n\n==== Image run ====\nRunning [[Vagrant Image]] described by link.\n\n=== EC2 image installation ===\n\n==== Prerequisites ====\n\n* ansible >= 1.9\n* boto(package for python)   \'\'\'<code>pip install boto</code>\'\'\'\n\n==== Image run ====\nRunning [[EC2 Image]] described by link.\n\n== Description of Installation process ==\n=== EC2 (ec2_install.yaml) ===\n\n1) You run \"Ansible\"<br>\n2) Ansible check ssh keys(group_vars/all in variable ssh_keys) stored in EC2.<br>\n* If key doesn\'t exist in ec2 database, it would be created.\n* if it doesn\'t nothing will change.\n3) Ansible check security group. and open:\n* icmp for all\n* 80 and 22 port for address 195.110.40.7/32\n* 80 and 22 port for address 89.139.27.211/32\nIf its already exist, ansible do not change anything.<br>\n4) Ansible create machine in EC2 cloud.(if you run script second time, it will create another machine)<br>\n5) Ansible get information about created machine and setup it:<br>\n6) Last task - Ansible print some additional information<br>','utf-8'),(10,'== Modules for nagios ==\n\n* [[Nagios_plugins]]\n\n== Installation of image ==\n\n=== Vagrant ===\n\n==== Prerequisites ====\n\n* vagrant (vagrantup.com), >= 1.5.3\n* virtualbox \n* ansible >= 1.9\n\n==== Image run ====\nRunning [[Vagrant Image]] described by link.\n\n=== EC2 image installation ===\n\n==== Prerequisites ====\n\n* ansible >= 1.9\n* boto(package for python)   \'\'\'<code>pip install boto</code>\'\'\'\n\n==== Image run ====\nRunning [[EC2 Image]] described by link.\n\n== Description of Installation process ==\n=== EC2 (ec2_install.yaml) ===\n\n1) You run \"Ansible\"<br>\n2) Ansible check ssh keys(group_vars/all in variable ssh_keys) stored in EC2.<br>\n* If key doesn\'t exist in ec2 database, it would be created.\n* if it doesn\'t nothing will change.\n3) Ansible check security group. and open:\n* icmp for all\n* 80 and 22 port for address 195.110.40.7/32\n* 80 and 22 port for address 89.139.27.211/32\nIf its already exist, ansible do not change anything.<br>\n4) Ansible create machine in EC2 cloud.(if you run script second time, it will create another machine)<br>\n5) Ansible get information about created machine and setup roles:<br>\n* nagios_server\n* nagios_client (nrpe + with custom plugin)\n* mediawiki\n* ibm (sample files)\n6) Last task - Ansible print some additional information<br>','utf-8'),(11,'== Modules for nagios ==\n\n* [[Nagios_plugins]]\n\n== Installation of image ==\n\n=== Vagrant ===\n\n==== Prerequisites ====\n\n* vagrant (vagrantup.com), >= 1.5.3\n* virtualbox \n* ansible >= 1.9\n\n==== Image run ====\nRunning [[Vagrant Image]] described by link.\n\n=== EC2 image installation ===\n\n==== Prerequisites ====\n\n* ansible >= 1.9\n* boto(package for python)   \'\'\'<code>pip install boto</code>\'\'\'\n\n==== Image run ====\nRunning [[EC2 Image]] described by link.\n\n== Description of Installation process ==\n=== EC2 (ec2_install.yaml) ===\n\n1) You run \"Ansible\"<br>\n2) Ansible check ssh keys(group_vars/all in variable ssh_keys) stored in EC2.<br>\n* If key doesn\'t exist in ec2 database, it would be created.\n* if it doesn\'t nothing will change.\n3) Ansible check security group. and open:\n* icmp for all\n* 80 and 22 port for address 195.110.40.7/32\n* 80 and 22 port for address 89.139.27.211/32\nIf its already exist, ansible do not change anything.<br>\n4) Ansible create machine in EC2 cloud.(if you run script second time, it will create another machine)<br>\n5) Ansible get information about created machine and setup roles:<br>\n* nagios_server\n* nagios_client (nrpe + with custom plugin)\n* mediawiki\n* ibm (sample files)\n6) Last task - Ansible print some additional information<br>\n\n=== Vagrant ===\n1) run \'\'\'vagrant up\'\'\'<br>\n2) vagrant creates machine with settings described in \"vagrant_variables.yaml\"<br>\n3) vagrant runs ansible.<br>\n4) Ansible get information about created machine and setup roles:<br>\n* nagios_server\n* nagios_client (nrpe + with custom plugin)\n* mediawiki\n* ibm (sample files)','utf-8'),(12,'== Modules for nagios ==\n\n* [[Nagios_plugins]]\n\n== Installation of image ==\n\n=== Vagrant ===\n\n==== Prerequisites ====\n\n* vagrant (vagrantup.com), >= 1.5.3\n* virtualbox \n* ansible >= 1.9\n\n==== Image run ====\nRunning [[Vagrant Image]] described by link.\n\n=== EC2 image installation ===\n\n==== Prerequisites ====\n\n* ansible >= 1.9\n* boto(package for python)   \'\'\'<code>pip install boto</code>\'\'\'\n\n==== Image run ====\nRunning [[EC2 Image]] described by link.\n\n== Description of Installation process ==\n=== EC2 (ec2_install.yaml) ===\n\n1) You run \"Ansible\"<br>\n2) Ansible check ssh keys(group_vars/all in variable ssh_keys) stored in EC2.<br>\n* If key doesn\'t exist in ec2 database, it would be created.\n* if it doesn\'t nothing will change.\n3) Ansible check security group. and open:\n* icmp for all\n* 80 and 22 port for address 195.110.40.7/32\n* 80 and 22 port for address 89.139.27.211/32\nIf its already exist, ansible do not change anything.<br>\n4) Ansible create machine in EC2 cloud.(if you run script second time, it will create another machine)<br>\n5) Ansible get information about created machine and setup roles:<br>\n* nagios_server (installs apache)\n* nagios_client (nrpe + with custom plugin)\n* mediawiki (installs php-mysql, mysql and so on)\n* ibm (sample files)\n6) Last task - Ansible print some additional information<br>\n\n=== Vagrant ===\n1) run \'\'\'vagrant up\'\'\'<br>\n2) vagrant creates machine with settings described in \"vagrant_variables.yaml\"<br>\n3) vagrant runs ansible.<br>\n4) Ansible get information about created machine and setup roles:<br>\n* nagios_server\n* nagios_client (nrpe + with custom plugin)\n* mediawiki\n* ibm (sample files)','utf-8'),(13,'== Prerequisites ==\n\n* Vagrant >= 1.5.3\n* Ansible >= 1.9\n* VirtualBox\n* git\n* python >= 2.7\n\n== Running Image ==\n\n* Install Vagrant from [http://www.vagrantup.com www.vagrantup.com]. Version must be \'\'\'>= 1.5.3\'\'\'\n* Install VirtualBox from [https://www.virtualbox.org/ www.virtualbox.org]\n* Install Ansible from [http://www.ansible.com/ www.ansible.com]. Required version \'\'\'>= 1.9\'\'\'\n\nClone code from repository\n<pre>git clone https://bitbucket.org/shinespb/ansible_task.git</pre>\n\nThen go to directory ansible task and run:\n<pre>\nvagrant up\n</pre>\n\nVagrant creates Virtual Machine, installs ubuntu 14.04 LTS and runs ansible.\nAnsible installs and setups all other software for this task like:\n* Nagios and additional plugins\n* Apache2\n* MySQL\n* MediaWiki\n=== Image already running but I\'ve changed some settings in playbooks ===\n\nYou need to run provisioning again, so run:\n```bash\nvargant provision\n```\nAnd it will run ansible.\n\n=== How I could get into machine? ===\n\n```bash\nvagrant ssh\n```\n\n== Settings for edit ==\n\n=== VM Settings ===\n\nVM settings can be set in file <ansible_variables.yml>\n<pre>\nmemory: 512\nvagrant_box: \"ubuntu/trusty64\"\nvms: 1\n</pre>\n\'\'\'Memory\'\'\' - means that vagrant will create Virtual Machines with this amount of RAM<br>\n\'\'\'vagrant_box\'\'\' - image to use. By default \"ubuntu/trusty64\". Ubuntu 14.04 LTS, x86_64<br>\n\'\'\'vms\'\'\' - Count of virtual machines that will be created<br>\n\n=== Software settings ===\nThere is a directory \"group_vars\" with file \"all\"\nIn this file you could change any parameters for this task','utf-8'),(14,'== Prerequisites ==\n\n* Vagrant >= 1.5.3\n* Ansible >= 1.9\n* VirtualBox\n* git\n* python >= 2.7\n\n== Running Image ==\n\n* Install Vagrant from [http://www.vagrantup.com www.vagrantup.com]. Version must be \'\'\'>= 1.5.3\'\'\'\n* Install VirtualBox from [https://www.virtualbox.org/ www.virtualbox.org]\n* Install Ansible from [http://www.ansible.com/ www.ansible.com]. Required version \'\'\'>= 1.9\'\'\'\n\nClone code from repository\n<pre>git clone https://bitbucket.org/shinespb/ansible_task.git</pre>\n\nThen go to directory ansible task and run:\n<pre>\nvagrant up\n</pre>\n\nVagrant creates Virtual Machine, installs ubuntu 14.04 LTS and runs ansible.\nAnsible installs and setups all other software for this task like:\n* Nagios and additional plugins\n* Apache2\n* MySQL\n* MediaWiki\n=== Image already running but I\'ve changed some settings in playbooks ===\n\nYou need to run provisioning again, so run:\n<pre>\nvargant provision\n</pre>\n\nAnd it will run ansible.\n\n=== How I could get into machine? ===\n\n<pre>\nvagrant ssh\n</pre>\n\n== Settings for edit ==\n\n=== VM Settings ===\n\nVM settings can be set in file <ansible_variables.yml>\n<pre>\nmemory: 512\nvagrant_box: \"ubuntu/trusty64\"\nvms: 1\n</pre>\n\'\'\'Memory\'\'\' - means that vagrant will create Virtual Machines with this amount of RAM<br>\n\'\'\'vagrant_box\'\'\' - image to use. By default \"ubuntu/trusty64\". Ubuntu 14.04 LTS, x86_64<br>\n\'\'\'vms\'\'\' - Count of virtual machines that will be created<br>\n\n=== Software settings ===\nThere is a directory \"group_vars\" with file \"all\"\nIn this file you could change any parameters for this task','utf-8'),(15,'== Prerequisites ==\n\n* ansible >= 1.9\n* boto(package for python)\n* python >= 2.7 \n\n== Running Image ==\n\n* Install Ansible from [http://www.ansible.com/ www.ansible.com]. Required version \'\'\'>= 1.9\'\'\'\n* install python => 2.7\n* Install boto\n<pre>pip install boto</pre>\n\nClone code from repository\n<pre>git clone https://bitbucket.org/shinespb/ansible_task.git</pre>\n\nGo inside cloned directory and run:\n<pre>export ANSIBLE_HOST_KEY_CHECKING=no; ansible-playbook -i hosts -u=ubuntu ec2_install.yaml</pre>\n\nAnsible do this: \n1) check ssh keys in ec2<br>\n2) check security groups<br>\n3) create VM in EC2<br>\n3) install setups all other software for this task like:\n* Nagios and additional plugins\n* Apache2\n* MySQL\n* MediaWiki','utf-8');
